function initMultiTextFieldPicker(e){if(e){var t=e.id,i=JSON.parse(e.dataset.selectedvalues||"[]"),u=JSON.parse(e.dataset.options||"[]"),n=Vue.component("vue-multiselect",window.VueMultiselect.default),a=new CustomEvent("multitextfield-picker-created",{detail:{vm:new Vue({el:"#"+t,components:{"vue-multiselect":n},data:{value:i,options:u,valuesKey:e.dataset.valueskey},watch:{value:function(){setTimeout(function(){$(document).trigger("contentpreview:render")},100)}}})}});document.querySelector("body").dispatchEvent(a)}}